import style from "./App.module.css";
import Navbar from "./Components/UI/NavBar";
import AuthContext, {AuthContextProvider} from "./Contexts/AuthContext";
import Content from "./Components/Content";

function App() {

  return (
    <AuthContextProvider>
      <div className={style.main}>
        <Navbar/>
        <Content/>
      </div>
    </AuthContextProvider>
  );
}

export default App;
